パックスナチュロン ボディーソープ 880ml<br>ブランド：パックスナチュロン<br>販売・製造元：太陽油脂<br><br>石けんの主原料にヒマワリ油を使用した、植物性石けんのボディシャンプーです。ビワ葉キス配合。素肌の潤いを保ちます。合成界面活性剤、合成酸化防止剤、防腐剤、着色料無添加。香料はローズマリー、ラベンダー、エストラゴン、ゼラニウムなどの精油を原料にしたフレッシュハーバルグリーンの香りです。濃密な泡をつくりだす『エコホイッパー』付きボトルを使用。泡が全身をやさしく洗い上げます。 <br>使用方法使い始めはポンプ部分のストッパーを外し、ポンプを数回押すと泡が出てきます(1押しで3mlが約10倍の泡になって出てきます)。適量をタオル、スポンジ、手のひらにとってご使用ください。※洗髪に使用したときは、石けんシャンプー専用のリンスをごしよういただくことにより、しっとり仕上がります(パックスナチュロンリンス(別売)とのセットしようがおすすめです)。 使用上の注意※本品は飲み物ではありません。●目に入らないように注意し、万一目に入った場合はこすらずに、すぐに流水で十分洗い流してください。●お肌に異常があるときや、使用中に赤み、はれ、かゆみなどが現れた場合は、ご使用をおやめください。●日の当たらない涼しい場所で保管してください。●石けんに由来する成分が沈むことがありますが、ご使用に支障はございません。●天然成分を使用していますので、時間の経過とともに色やにおいが強くなることがあります。●乳幼児の手の届くところに置かないでください。●水や他の製品を入れないでください。 成分水、カリ石けん素地、グリセリン、トコフェロール(天然ビタミンE)、ビワ葉エキス、香料、クエン酸 原産国日本 お問い合わせ先太陽油脂株式会社TEL：045-441-4953 ボディソープ全部とはボディの汗・皮脂などの汚れ、余分な角質等を洗いおとし、清潔な肌に整えます。ボディー向け洗浄料です。<br>日用品／洗面・バス用品／ボディシャンプー(ボディソープ)／低刺激ボディシャンプー<br>JANコード： 4904735055211<br><br>CS：8<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
