パックスナチュロン リンス 400ml(石鹸シャンプー用リンス)<br>ブランド：パックスナチュロン<br>販売・製造元：太陽油脂<br><br>ホホバオイル配合の石けんシャンプー専用リンスです。石けんシャンプーを使用した後の髪を弱酸性にもどし、しっとりさせ、つややかさを保ちます。合成界面活性剤、合成酸化防止剤、防腐剤、着色料無添加。香料はローズマリー、ラベンダー、ユーカリ、オレンジなどの精油を原料にしたシトラスフローラルの香りです。 <br>使用方法適量をお湯でうすめ、髪になじませた後、洗い流してください。天然の原料を使用しているため、分離することがあります。軽く振ってお使いください。●使用量目安：洗面器7分目くらいのお湯に本品約6ml(髪の長さや量によって加減してください) 使用上の注意※本品は飲み物ではありません。●目に入らないように注意し、万一目に入った場合はこすらずに、すぐに流水で十分洗い流してください。●頭皮に異常があるときや、お肌や髪に合わない場合は、ご使用をおやめください。●日の当たらない涼しい場所で保管してください。●天然成分を使用していますので、時間の経過とともに色やにおいが強くなることがあります。●乳幼児の手の届くところに置かないでください。●水や他の製品を入れないでください。 成分水、クエン酸、エタノール、グリセリン、ホホバ油、キサンタンガム、香料、クエン酸Na 原産国日本 お問い合わせ先太陽油脂株式会社TEL：045-441-4953 リンス・コンディショナー全部とはリンス(コンディショナー)は、髪表面を保護する成分により、洗髪後の髪をなめらかに整え、ダメージから守ります。<br>日用品／ヘアケア／リンス・コンディショナー／低刺激リンス<br>JANコード： 4904735055167<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
