植物物語 ハーブブレンドボディソープ サボン(せっけん)の香り 詰替用420m<br>ブランド：植物物語<br>販売・製造元：ライオン<br><br>植物生まれの低刺激洗浄成分に、こだわりの天然ハーブエキス(カモミールとローズヒップ)をブレンドしたアロマボディシャンプー(詰替用)です。<br>うるおいのヴェールでお肌の表面を保護し水分を守りながら、みずみずしくすべすべのお肌に洗い上げます。<br>洗う成分の100%が植物生まれ。<br>クリーミィな豊かな泡でやさしく全身を包み込みます。<br>ローズから抽出したエッセンシャルオイル配合。<br>ココロやすらぐ、やさしいせっけんの香りです。<br> <br>ご<br><br>使用方法<br>お湯を含ませたタオルやスポンジなどに適量をとり、軽くもむようにして泡立ててお使いください。<br> ご<br><br>使用上の注意<br>・お肌に傷、はれもの、湿疹等異常のあるときは使用しないでください。<br>・使用中、赤み、はれ、かゆみ、刺激等の異常が現れたときは使用を中止し、商品を持参し、医師に相談してください。<br> 全成分水、ミリスチン酸、PG、ラウリン酸、水酸化カリウム、ラウラミドプロピルベタイン、アクリル酸アルキルコポリマー、ステアレス-11、ノバラエキス、カミツレエキス、香料、ポリスチレン、EDTA、ポリクオタニウム-7、安息香酸ナトリウム、ポリクオタニウム-10、BG、エタノール ボディソープ全部とはボディの汗・皮脂などの汚れ、余分な角質等を洗いおとし、清潔な肌に整えます。<br>ボディー向け洗浄料です。<br><br>日用品／洗面・バス用品／ボディシャンプー(ボディソープ)／ボディソープ全部<br>JANコード： 4903301327028<br><br>CS：16<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
